import React from "react";

export function Footer()
{
	return (
		<footer>
			<div id='footerUpperPart'>
				<p>Coded by</p>
			</div>
			<div id='footerLowerPart'>
				<p>Urbain Dumas</p>
				<p>Vincent Da Conceicao Ramos</p>
			</div>
		</footer>
	);
}
